import React, { useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, useLocation } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar';
import Home from './components/Home';
import Forum from './components/Forum';
import Schedule from './components/Schedule';
import JoinUs from './components/JoinUs';
import Races from './components/Races';
import CoachesExec from './components/CoachesExec';
import Admin from './components/Admin';
import Login from './components/Login';
import WorkoutDetail from './components/WorkoutDetail';
import EventDetail from './components/EventDetail';
import Profile from './components/Profile';
import FAQ from './components/FAQ';
import Resources from './components/Resources';
import TeamGear from './components/TeamGear';
import Footer from './components/Footer';
import { AuthProvider } from './context/AuthContext';

// Scroll to top on route change
const ScrollToTop = () => {
  const location = useLocation();
  useEffect(() => {
    window.scrollTo(0, 0);
  }, [location.pathname]);
  return null;
};

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <ScrollToTop />
          <Navbar />
          <main>
                    <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/forum" element={<Forum />} />
          <Route path="/schedule" element={<Schedule />} />
          <Route path="/join-us" element={<JoinUs />} />
          <Route path="/races" element={<Races />} />
          <Route path="/coaches-exec" element={<CoachesExec />} />
          <Route path="/faq" element={<FAQ />} />
          <Route path="/resources" element={<Resources />} />
          <Route path="/team-gear" element={<TeamGear />} />
          <Route path="/admin" element={<Admin />} />
          <Route path="/profile" element={<Profile />} />
        <Route path="/profile/:role/:name" element={<Profile />} />
          <Route path="/login" element={<Login />} />
          <Route path="/workout/:id" element={<WorkoutDetail />} />
          <Route path="/event/:id" element={<EventDetail />} />
        </Routes>
          </main>
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
